//COMPONENTS
import NavBar from "../components/NavBar";
import { Container, Row, Col } from "react-bootstrap";

const Home = () => {
  return (
    <Container fluid>
      <NavBar />
      <Row></Row>
      <Row className="justify-content-center">
        <Col xs="3" className="justify-content-center">
          <p>Homes</p>
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
